import FadeUpOnScroll from "./FadeUpOnScroll";

const FooterContainer = () => {
    return (
        <FadeUpOnScroll>
            <footer>
                <div className="footerContainer">
                    <p>© 2025 Ganesh Telore. All rights reserved.</p>
                    <p>Your Innovator in Code, <span>GT</span> — Signing Off!</p>
                </div>
            </footer>
        </FadeUpOnScroll>
    )
};

export default FooterContainer;
